import React from "react";

function Rating(props) {
  const { rating, numReviews } = props;
  return (
    <div>
      <div className="rating">
        <span>
          <i
            className={
              rating >= 1
                ? "fa-fa-star"
                : rating >= 0.5
                ? "fa fa-star-half-o"
                : "fa-star-o"
            }
          ></i>
        </span>
        <span>
          <i
            className={
              rating >= 1
                ? "fa-fa-star"
                : rating >= 0.5
                ? "fa fa-star-half-o"
                : "fa-star-o"
            }
          ></i>
        </span>
      </div>
    </div>
  );
}

export default Rating;
